import React from 'react';
import {CustomizedButtom} from './style';

export default function Button(props){
    return (
        <>
            <CustomizedButtom className="col-lg-12 col-md-12 col-sm-12 col-xs-12  button-wrapper">
                <span>{props.content}</span>
            </CustomizedButtom>
        </>
    )
}
